from sklearn.metrics import precision_score, recall_score, f1_score


def calculate_scores(dataset, names_list):
    y_true = [entry['Name'] in names_list for entry in dataset]  # True if the person attended the event
    y_pred = [entry['predicted_attendance'] for entry in dataset]  # Predictions from the model

    precision = precision_score(y_true, y_pred)
    recall = recall_score(y_true, y_pred)
    f1 = f1_score(y_true, y_pred)

    return precision, recall, f1



